source_text:
§a§nAction 

§rThe activator module can simulate: 
- Activating a block (e.g. flipping a lever); 
- Right-clicking an item (e.g. using a flint & steel, which must be in the router's buffer); 
- or right-clicking the nearest entity (e.g. milking a cow with a bucket in the router's buffer).

target_text:
§a§nアクション

§rアクティベーターモジュールは以下をシミュレートできます：
- ブロックのアクティベーション（例：レバーの切り替え）;
- アイテムの右クリック（例：火打石と鋼を使用。ルーターのバッファに含まれている必要があります）;
- または最も近いエンティティを右クリック（例：バケツを使用して牛を搾乳）。

source_text:
§a§nLook Direction 

§rWhen right-clicking, the router can: 
- Face level, targeting a block directly in the module's direction, up to 4 blocks away; 
- Look upward, targeting the block directly above the block in the module's direction; 
- Look downward, targeting the block directly below the block in the module's direction.

§a§nRedstone Signal Strength 

§r- A §oweak§r redstone signal will power the adjacent block only; 
- A §ostrong§r redstone signal will power the adjacent block and blocks adjacent to that block (like a vanilla Repeater).

target_text:
§a§nレッドストーン信号強度

§r- §o弱い§rレッドストーン信号は隣接するブロックのみに電力を供給します;
- §o強い§rレッドストーン信号は隣接するブロックと、そのブロックに隣接するブロックに電力を供給します（バニラのリピーターのように）。
